    "FaqsData": "<ol class=\"questions\">\r\n\r\n               <li>\r\n<h6>注文はできますか?</h6>\r\n\r\n<p>はい、UCM(ユニバーサルクラフトマーケット)の納入は現在継続中です。ただし、配送時間は通常よりも長くなる場合があります。現在の状況により閉鎖される可能性のある建物(オフィスなど)の配送先住所は使用しないでください</p>\r\n\r\n               </li>\r\n               <li>\r\n<h6>UCM(ユニバーサルクラフトマーケット)はパッケージを提供しますか?</h6>\r\n\r\n<p>我々はこれらの製品の可用性を確保するために24時間体制で取り組んでおり、顧客の注文を提供するための追加の能力を引き続き持ち込んでいます。在庫の中から利用可能な品揃えがすべて出荷され続けています</p>\r\n\r\n               </li>\r\n               <li>\r\n<h6>貨物を追跡するにはどうすればよいですか?</h6>\r\n\r\n<p>UCM(ユニバーサルクラフトマーケット)で出荷を追跡するには、<>>/ホーム/トラックオーダー」>注文を追跡する</a>をクリックします</p>\r\n\r\n               </li>\r\n               <li>\r\n<h6>それでも注文を返すことができますか?</h6>\r\n\r\n<p>はい、返品を作成できます。詳細については、当社の<a href=/ホーム/保証リターンポリシー>返品および払い戻しポリシー</a>をご覧ください</p>\r\n\r\n               </li>\r\n               <li>\r\n<h6>注文を受け取っても安全ですか?</h6>\r\n\r\n<p>常にお客様と配送先の人の安全を優先します。私たちは、それが安全である場合にのみ提供し続けます。COVID-19に関するガイダンスについては、<a href=https://www.who.int/emergencies/diseases/novel-coronavirus-2019ターゲット=_blank世界保健機関>ウェブサイトを参照してください</a></p>\r\n\r\n               </li>\r\n               <li>\r\n<h6>UCM(ユニバーサルクラフトマーケット)は価格ガウジングについて何をしていますか?</h6>\r\n\r\n<p>UCM(ユニバーサルクラフトマーケット)に価格を高騰させる場所はありません。サージ価格に関与していないことを確認できます。低価格のオファーはすぐに売り切れ、第三者の売り手からのより高い価格のオファーを残しています。当社は積極的に当社のウェブサイトを監視し、最近の平均販売価格を大幅に上回るオファーを削除しています</p>\r\n\r\n               </li>\r\n           </ol>",
