    "guaranteeReturnPolicy": "<p>私たちは、あなたが私たちの顧客であることを見て非常に幸せですし、私たちのウェブサイトで買い物をしていただきありがとうございます</p>\r\n\r\n<p>あなたがあなたの購入に完全に満足していない場合、我々は助けるためにここにいます.</p>\r\n\r\n<h5>返品</h5>\r\n\r\n<p>アイテムを受け取った日付からアイテムを返すカレンダー日が 14 日ある場合。返品の対象となるには、品目が未使用で、返品可能な状態になるためには、受け取った条件と同じ状態である必要があります。アイテムは、元のパッケージとタグに含まれる必要があります。また、有効な領収書または購入証明が必要です</p>\r\n\r\n<h5>払い戻し</h5>\r\n\r\n<p>アイテムを受け取ったら検査され、返品を受け取ったことが通知されます。検査後直ちに返金状況をお知らせします。払い戻しについては、お客様が選択した支払い方法に応じて、以下の方法に従います。配達時の現金(COD)の場合、お客様の払い戻しは、顧客の玄関口で検査、検証、収集が完了すると、1〜7営業日以内に銀行口座に反映されます。(Google Pay、PayPalなどを使用して)デジタルで行われた支払いは即座に処理されます。ソースアカウント(クレジットカード、デビットカード、ネットバンキング)への払い戻しの場合、銀行パートナーに応じて銀行口座に返金するには7~10日かかる場合があります。銀行、カードポリシー、支払い方法に応じて、一定の日数以内に全額クレジットを受け取</p>\r\n\r\n<h5>出荷</h5>\r\n\r\n<p>商品を返品するための配送料を支払う責任があります。送料は返金不可です。払い戻しを受けた場合、返送料は払い戻しから差し引かれます</p>\r\n\r\n\r\n<h3>お問い合わせ</h3>\r\n\r\n<p>商品を返品する方法や払い戻しの開始方法についてご不明な点がございましたら、<>href=/ホーム/お問い合わせ>お問い合わせください</a></p>",
