    "paymentMethodsData": "<h3>支払方法</h3>\r\n\r\n<h5>受け入れ可能な支払方法</h5>\r\n\r\n<p>ユニバーサルクラフトマーケットでは、クレジットカードやデビットカード、代金引換払い(現金)、デジタル決済方法(Google Pay、Apple Pay、PayPalなど)などのさまざまな支払い方法を受け付けています。クレジットカードで私たちは受け入れる - ビザ、マスターカード、ディスカバー、アメリカンエキスプレス、ダイナースクラブ、JCB.</p>\r\n\r\n<p><strong>注</strong>場合によっては、ビザとマスターカードのクレジットカードを使用する場合があります。このような場合、チェックアウト プロセスは明確になり、既定の支払い方法を追加できます</p>\r\n\r\n<h5>支払い方法の管理</h5>を<!--\r\n\r\n<p>お支払い方法はアカウントの支払いセクションで管理できます</p>\r\n\r\n<p>\r\n\r\nアカウントで支払い方法を追加または更新するには:\r\n\r\n<ol>\r\n\r\n<li>アカウントに移動する]セクション</li>\r\n\r\n<li>支払いオプションセクションで、ユニバーサルマーケットアカウントにログインするよう求められます。ユニバーサルマーケットアカウントにログインしたら、次のいずれかの操作を行います</li>\r\n\r\n                   <li>\r\n新しいお支払い方法を追加するには、[カードを追加] をクリックします。<br />\r\n\r\nお支払い方法を編集/更新/削除するには、「クレジットカードとデビットカード」セクションから保存したカードを選択し、要件に従って[編集]または[削除]ボタンをクリックします。\r\n\r\n\r\n                   </li>\r\n<li>次の画面上の指示に従ってください。.</li>\r\n\r\n               </ol>\r\n           </p>    \r\n           <p>\r\n<strong>注文時に新しい支払い方法を追加するには:</strong>\r\n\r\n               <ol>\r\n<li>カートに品目を追加し、チェックアウトに進みます</li>\r\n\r\n<li>お支払い方法を選択する] リンクで、[お支払い方法の追加] セクションで [カードの追加] を選択して、クレジット カードまたはデビット カードの詳細を追加できます</li>\r\n\r\n<li>注文を続ける</li>\r\n\r\n               </ol>\r\n           <p>\r\nこれらの詳細は保存され、次のユニバーサルマーケット注文を行うときに保存されたクレジットカードまたはデビットカードとして表示されます。\r\n\r\n           </p>\r\n<p><strong>宅配便(COD)支払い方法の携帯電話番号を確認するには:</strong>\r\n\r\n                  <ol>\r\n<li>配達時の現金支払い方法を選択しながら、あなたの携帯電話番号を確認し、ユニバーサルクラフトマーケットに登録する必要があります</li>\r\n\r\n<li>配達方法として現金配達を選択すると、アカウントに登録されている携帯電話番号に送信されるワンタイムパスワード(OTP)を入力するよう求められます</li>\r\n\r\n<li>完了したら、[続行]をクリックして注文を続行します</li>\r\n\r\n                  </ol>\r\n           </p>\r\n           <p>\r\n<string>注:</string>OTPを受け取らない場合:\r\n\r\n               <ol>\r\n<li>再送信を選択します </li>。\r\n\r\n<li>携帯電話番号が空白なしで正しく入力されていることを確認します。編集するには、[変更] をクリックします</li>\r\n\r\n               </ol>\r\n           </p>-->\r\n<h3>安全な支払い</h3>\r\n\r\n<p>当社に対するすべての支払いは安全であり、SSLおよびPCI DSSコンプライアンスに従います</p>\r\n\r\n<p>ビザ/マスターカード/PayPal SSLを使用する: すべての取引は SSL プロトコルで保護されています。SSL を使用すると、データと情報を暗号化し、カードの詳細やその他の機密データをすべて保護できます。</p>\r\n\r\n<p><strong>PCI:</strong>支払いカード業界データセキュリティ基準(PCI DSS)は、支払い処理で機密データを保護するために何をする必要があるかを伝える加盟店向けのガイドラインを提供します</p>\r\n\r\n<p><strong>注:</strong> 当社のウェブサイトにカード情報を保存したり保存したりすることはありません</p>\r\n\r\n「今すぐ支払う」をクリックすることで、ucraftmarket.com が定めるポリシー、利用規約に同意し、同意します。私は、支払いや取引に対して、この国の管轄によって定められたガバナンスと規制に同意し、遵守します。",
    "paymentNotify": "<p>お客様が使用するクレジットカードまたはデビットカードの支払い方法は、取引中の個人を特定できる情報や、クレジットカード番号やログインなどの他の機密情報を保護することを意味するSSL暗号化によって保護されています。当社は情報を保存または共有することはなく、お支払い情報を他の場所で使用することはありません。詳細については、当社の「利用規約」および「プライバシーポリシー」を確認してください</p>",
