    "privacyPolicyData": "<p>ユニバーサルクラフトマーケットは、子会社を含む ucraftmarket.com、そのアプリケーション、ソフトウェアを運営および管理しています。このドキュメントは、当社のプラットフォーム全体のユーザーから受け取った個人情報の収集、使用、開示に関する当社の方針をお知らせします</p>\r\n\r\n<p>お客様の個人情報は、カスタマーサービスとエクスペリエンスの向上のためにのみ使用します。当社のプラットフォームを使用することにより、お客様は本ポリシーに従って情報の収集と使用に同意</p>\r\n\r\n\r\n<h3>情報収集と利用</h3>\r\n\r\n<p>当社は、お客様への連絡や特定に使用できる特定の個人を特定できる情報を提供するよう求める場合があります。個人としては、識別可能な情報には、お客様の氏名、年齢、性別、所在地が含まれますが、これらに限定されません </p>。\r\n\r\n\r\n<h5>ログ データ</h5>\r\n\r\n<p>当社は、お客様が当社のウェブサイトやアプリケーションを訪問するたびに、お客様のブラウザが送信する情報を収集します。このログデータには、お客様のコンピュータのIPアドレス、ブラウザの種類、ブラウザのバージョン、訪問したウェブサイトのページ、訪問日時、それらのページに費やされた時間、その他の類似の統計などの情報が含まれる場合があります。また、Google アナリティクスなどの第三者サービスを利用して、このデータを収集、監視、分析することがあります </p>。\r\n\r\n\r\n<h5>コミュニケーション</h5>\r\n\r\n<p>当社は、お客様の中心性と経験を向上させるために使用されるマーケティング資料、プロモーション資料、その他の情報を連絡するために、お客様の個人情報を使用することがあります。当社は、電子メール、ニュースレター、その他の方法でユーザーに連絡することがあります。</p>\r\n\r\n\r\n<h5>クッキー</h5>\r\n\r\n<p>HTTPクッキーまたはインターネットクッキーは、インターネットWebブラウザが各ユーザーのセッションに関する情報を追跡、パーソナライズ、保存するために特別に構築された小さなデータです</p>\r\n\r\n<p>クッキーは、Web サイトからブラウザに送信され、ハードドライブなどのコンピュータの物理記憶装置に保存されます。当社は、情報収集のためにクッキーを使用します。ブラウザに対して、すべてのクッキーを拒否するか、クッキーが送信されるタイミングを示すように指示することができます。ただし、Cookieを受け入れない場合は、当社のサイトの一部を使用できない場合があります</p>\r\n\r\n\r\n<h5>セキュリティ</h5>\r\n\r\n<p>データのセキュリティは最優先であり、当社にとって重要です。すべてのセキュリティ対策にもかかわらず、我々はインターネット上の送信の方法、または物理的なストレージデバイスやメディアにデータを格納する方法は100%安全であることを覚えておく必要があります。当社は、お客様のデータを保護するために商業的に許容される手段を使用するよう努めていますが、絶対的なセキュリティで保証することはできません</p>\r\n\r\n\r\n<h3>このプライバシーポリシーの変更</h3>\r\n\r\n<p>本プライバシーポリシーは、01-01-2020の時点で有効であり、当社のウェブサイトに掲載された直後に有効となる将来の規定の変更に関しては、有効なままです </p>。\r\n\r\n<p>当社はいつでも当社のプライバシーポリシーを更新または変更する権利を留保し、定期的に本プライバシーポリシーを確認する必要があります。本ページにプライバシーポリシーに変更を掲載した後、お客様が本サービスを引き続き使用することは、お客様が変更を承認し、変更されたプライバシーポリシーに従い、拘束されるものとします。本プライバシーポリシーに重大な変更を加えた場合、当社は、お客様から提供されたメールアドレスを通じて、または当社のウェブサイトに目立つ通知を掲載してお客様に通知します </p>。\r\n\r\n\r\n<h3>お問い合わせ</h3>\r\n\r\n<p>本プライバシーポリシーに関するご質問やご質問がある場合は、<>/ホーム/お問い合わせ>お問い合わせ</a></p>",
